import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {
  const expenses =
    props.expenses.length !== 0 ? (
      props.expenses.map((expense) => {
        return (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        );
      })
    ) : (
      <p>Could not find any expenses</p>
    );

  return { expenses };
};

export default ExpensesList;
